import React from 'react';
import { Link } from 'react-router-dom';
import './Navigation.css';


function Navigation() {
  return (
    <div><img src='./mainyouflex.JPG' width= "10px" alt="Home" />
      
    </div>,
    <Link to="/">
    <div className="nav">
      
      <img src='./mainyouflex.JPG' width= "200px" alt="Home" />
      
    </div></Link>
  );
}

export default Navigation;
